import React from 'react';
import Home from './views/Home/Home';
import Landing from './views/Landing/Landing';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Home></Home>
        <Landing></Landing>
      </header>
    </div>
  );
}

export default App;
